function gallery(){const e=document.querySelectorAll(".language-gallery");Array.from(e).forEach(e=>{const t=e.textContent.trim().split("\n");e.parentNode.insertAdjacentHTML("beforebegin",`<div class="picGallery"></div>`);const n=e.parentNode.previousSibling;t.forEach(e=>{e&&n.insertAdjacentHTML("beforeend",`<div><img src="${e.trim()}" data-lazy-src="${e.trim()}"></div>`)})});const t=document.querySelectorAll('.picGallery');t.forEach(e=>{new Viewer(e,{navbar:!0,toolbar:!0,title:!0,rotatable:!0,zoomable:!0})})}gallery()